import React from "react";
import { Link } from "react-router-dom";

import ImageControls from "../ImageControls/image-controls.components";
import LazyImage from "../LazyImage/lazy-image.component";

cyanClick = (el) => {
  console.log("cyan click");
  console.log(el);
};

copyToClipboard = (el) => {
  navigator.clipboard.writeText(el.alt_description).then(
    (res) => console.log("set"),
    (err) => console.log(err)
  );
};

const ImageItem = (element) => (
  <div>
    <Link to={`/image/${element.id}`}>
      <LazyImage {...element} />
    </Link>
    <ImageControls
      {...element}
    />
  </div>
);

export default ImageItem;
